==Demographics== As of the [[2001 Census of India]],<ref>{{cite web|url=http://www.censusindia.net/results/town.php?stad=A&state5=999|archiveurl=https://web.archive.org/web/20040616075334/http://www.censusindia.net/results/town.php?stad=A&state5=999|archivedate=2004-06-16|title= Census of India 2001: Data from the 2001 Census, including cities, villages and towns (Provisional)|accessdate=2008-11-01|work= |publisher= Census Commission of India}}</ref>'''Bilram''' is a town and a nagar panchayat in [[Kasganj districtj]] in the state of Uttar Pradesh, India. Bilram had a population of 12,119. Males constitute 54% of the population and females 46%. Bilram has an average literacy rate of 29%, lower than the national average of 59.5%; with male literacy of 37% and female literacy of 20%. 18% of the population is under 6 years of age.
